script: |
  super -f text -I q9102.spq | sort > q9102.out

inputs:
  - name: q9102.spq
    data: |
      SELECT ALL - col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN - col2 - - 38 AND 17 * + - col1 * - CAST ( NULL AS INTEGER ) * - col0;
  - name: tab0

outputs:
  - name: q9102.out
    data: |
